import React from 'react';
import './darkMode.scss'
import { useState } from 'react';


function DarkMode(props) {

    const [isFlexEnd, setIsFlexEnd] = useState('0');

    

    const handleClick = () => {
        setIsFlexEnd(!isFlexEnd);
      };
    
      const containerStyle = {
        
        transform: isFlexEnd ? 'translateX(115%)' : 'translateX(1%)',
        
      };

    
 



    return ( 

        <div className='button--container' >
            
            
            <div className='button--border' > 
            <div className='button--circle' style={containerStyle} onClick={handleClick}></div>

            </div>

        </div>

     );
}

export default DarkMode;
